import Menu from './Menu'
import "./Header.css"

export default function Header(props) {
  let s1={
    backgroundColor:'green',
    color:'white'
  }
  return (
    <div>
      
      <h1 className="s2" style={s1}>{props.name},{props.branch}</h1>
      <Menu/>
      <hr />
    </div>
  )
}
